import React from "react";
import { LogoMobile, LogoDesktop } from "../../icons";
import styles from "./Navbar.module.scss";

function Navbar() {
  const navigationOptions = [
    {
      id: 1,
      title: "Головна",
      linkPage: "#main",
    },
    {
      id: 2,
      title: "Галерея",
      linkPage: "#gallery",
    },
    {
      id: 3,
      title: "Команда",
      linkPage: "#team",
    },
    {
      id: 4,
      title: "Послуги та ціни",
      linkPage: "#price",
    },
    {
      id: 5,
      title: "Сертифікати",
      linkPage: "#certificates",
    },
    {
      id: 6,
      title: "Контакти",
      linkPage: "#contacts",
    },
  ];
  return (
    <nav className={styles.navbarWrapper}>
      <div className={styles.navbarlogo}>
        <LogoMobile className={styles.logoMobile} />
        <LogoDesktop className={styles.logoDesktop} />
      </div>
      {/* mobile */}
      <ul className="app__navbar-links">
        {navigationOptions.map((item) => (
          <li className="app__flex p-text" key={item.id}>
            <div />
            <a href={`#${item}`}>{item}</a>
          </li>
        ))}
      </ul>
    </nav>
  );
}

export default Navbar;
